	useParams
  } from "react-router-dom";
function App() {
  return (
	  <>
			<Layout color="white">
				<Header />
				<Content>s
					<Switch>
						<Route exact path="/" component={Home} />
						<Route exact path="/profile" component={Profile} />
					</Switch>
				</Content>

				<Footer />
			</Layout>
	</>
	);
}

